<p>设要绘制的图形为<code>src</code>，已经绘制好的图形为<code>dst</code>。</p>
<blockquote>
<p>需要注意的是，这些图片除了要绘制的图形有着色之外，其他部分要为透明，并且<strong>包括透明区域在内的图片大小（宽高）要能完全覆盖另外一张图片的图形区域</strong>，否则绘制出的图形可能与预设的效果不一致</p>
